public boolean equals(Object obj) {
  if (this == obj)
    return true;
  if (obj == null)
    return false;
  if (getClass() != obj.getClass())
    return false;
  Result other = (Result) obj;
  if (descend != other.descend)
    return false;
  if (success != other.success)
    return false;
  return true;
}
